const images = {
    mood: require("../images/mood.svg").default,
    playlist: require("../images/playlist.svg").default,
    change: require("../images/change.svg").default,
    product: require("../images/product.svg").default,
    sleep: require("../images/sleep.svg").default,
    jazzy: require("../images/jazzy.svg").default,
    chill: require("../images/chill.svg").default,
    volumemin: require("../images/volumemin.svg").default,
    volumemax: require("../images/volumemax.svg").default,
    premium: require("../images/premium.svg").default,
};

export default images;
